import Logger from './Logger';
import ConsoleHandler from './handlers/ConsoleHandler';

/**
 * A simplified way of creating a {@link Logger} with a {@link ConsoleHandler}
 */
export default class ConsoleLogger extends Logger {

    /**
     * Creates a new ConsoleLogger with a prefix.
     *
     * If no min level is specified, the min level is ALL if name is in `process.env.DEBUG`, else WARN
     *
     * @param {string} name
     * @param {int} [minLevel]
     */
    constructor(name, minLevel) {
        super([
            new ConsoleHandler(minLevel != null ? minLevel : name),
        ]);

        this.setPrefix(`[${name}]`);
    }
}

import levels from './levels';

/**
 * Abstract class that handles a record.
 *
 * Has a min level to discard record lower that this level.
 */
export default class Handler {
    /**
     * @param {int} minLevel
     * @param {Layout} layout
     * @param {Output} output
     */
    constructor(minLevel, layout, output) {
        this.minLevel = minLevel;
        this.layout = layout;
        this.output = output;

        levels.forEach((level) => {
            if (level.value < minLevel) {
                this[level.lcKey] = function() {};
            }
        });
    }

    /**
     * @param {Object} record
     */
    handle(record) {
        if (record.level < this.minLevel) {
            return;
        }

        const formatted = this.layout.format(record);
        this.output.write(formatted);
    }
}

/**
 * List of levels
 *
 * <ul>
 * <li>ALL: Log everything. Not a level.</li>
 * <li>TRACE: Trace information</li>
 * <li>DEBUG: Detailed debug information</li>
 * <li>INFO: Normal but significant events</li>
 * <li>WARN: Exceptional occurrences that are not errors (Use of deprecated APIs)</li>
 * <li>WARNING: Alias for WARN</li>
 * <li>ERROR: Runtime errors that do not require immediate action but should be logged and monitored</li>
 * <li>CRITICAL: Critical conditions. Example: Application component unavailable, unexpected exception</li>
 * <li>FATAL: Action must be taken immediately. Example: Entire website down, database unavailable, etc
 *          This should trigger the SMS alerts and wake you up</li>
 * <li>ALERT: Alias for FATAL</li>
 * <li>EMERGENCY: Emergency: system is unusable</li>
 * </ul>
 *
 */
const LogLevel = Object.freeze({
    /** @type {Number} Log everything. Not a level. */
    ALL: 0,

    /** @type {Number} Trace information */
    TRACE: 10,
    /** @type {Number} Detailed debug information */
    DEBUG: 100,
    /** @type {Number} Normal but significant events */
    INFO: 200,
    /** @type {Number} Exceptional occurrences that are not errors (Use of deprecated APIs) */
    WARN: 300,
    /** @type {Number} Alias for WARN */
    WARNING: 300,
    /** @type {Number} Runtime errors that do not require immediate action but should be logged and monitored */
    ERROR: 400,
    /** @type {Number} Critical conditions. Example: Application component unavailable, unexpected exception */
    CRITICAL: 500,
    /** @type {Number} Action must be taken immediately. Example: Entire website down, database unavailable, etc
      *                 This should trigger the SMS alerts and wake you up */
    FATAL: 550,
    /** @type {Number} Alias for FATAL */
    ALERT: 550,
    /** @type {Number} Emergency: system is unusable */
    EMERGENCY: 600,
});
export default LogLevel;

import util from 'util';
import LogLevel from './LogLevel';

/**
 * Interface that allows you to log records.
 * This records are treated by handlers
 */
export default class Logger {
    /**
     * Create a new Logger
     *
     * @param {Handler[]} handlers
     */
    constructor(handlers) {
        this.handlers = handlers;

        Object.getOwnPropertyNames(Logger.prototype).forEach((key) => {
            if (key === 'constructor') {
                return;
            }

            this[key] = Logger.prototype[key].bind(this);
        });
    }

    /**
     * Write a message
     *
     * @param {String} message
     * @param {String} logLevel
     * @return {Logger}
     */
    write(message, logLevel) {
        this.output.write(message, logLevel);
        return this;
    }

    /**
     * Handle a record
     *
     * Use this only if you know what you are doing.
     *
     * @param {Object} record
     */
    addRecord(record) {
        for (let i = 0, length = this.handlers.length; i < length; i++) {
            let handler = this.handlers[i];
            if (handler.handle(record) === false) {
                return;
            }
        }
    }

    /**
     * Log a message
     *
     * @param {String} message
     * @param {Object} context
     * @param {int} [logLevel]
     * @param {Object} [options]
     * @return {Logger}
     */
    log(message, context, logLevel = LogLevel.INFO, options = undefined) {
        let record = {
            level: logLevel,
            prefix: this._prefix,
            datetime: new Date(),
            message: message,
            context: context,
            extra: {},
        };

        if (options) {
            record = Object.assign(options, record);
        }

        this.addRecord(record);
        return this;
    }

    /**
     * Set the logger prefix
     *
     * @param {String} prefix
     * @param {*} [styles]
     */
    setPrefix(prefix, styles) {
        this._prefix = prefix;
    }

    /**
     * Log an debug message
     *
     * @param {String} message
     * @param {Object} [context]
     * @param {Object} [contextStyles]
     * @return {Logger}
     */
    debug(message, context, contextStyles) {
        return this.log(message, context, LogLevel.DEBUG, { contextStyles });
    }

    /**
     * Log an info message
     *
     * @param {String} message
     * @param {Object} [context]
     * @param {Object} [contextStyles]
     * @return {Logger}
     */
    info(message, context, contextStyles) {
        return this.log(message, context, LogLevel.INFO, { contextStyles });
    }

    /**
     * Log an warn message
     *
     * @param {String} message
     * @param {Object} [context]
     * @param {Object} [contextStyles]
     * @return {Logger}
     */
    warn(message, context, contextStyles) {
        return this.log(message, context, LogLevel.WARN, { contextStyles });
    }

    /**
     * Log an error message
     *
     * @param {String|Error} message
     * @param {Object} [context]
     * @param {Object} [contextStyles]
     * @return {Logger}
     */
    error(message, context, contextStyles) {
        return this.log(message.stack || message.message || message, context, LogLevel.ERROR, { contextStyles });
    }

    /**
     * Log an alert message
     *
     * @param {String} message
     * @param {Object} [context]
     * @param {Object} [contextStyles]
     * @return {Logger}
     */
    alert(message, context, contextStyles) {
        return this.log(message, context, LogLevel.ALERT, { contextStyles });
    }

    /**
     * Log an fatal message
     *
     * @param {String} message
     * @param {Object} [context]
     * @param {Object} [contextStyles]
     * @return {Logger}
     */
    fatal(message, context, contextStyles) {
        return this.log(message, context, LogLevel.FATAL, { contextStyles });
    }

    /**
     * Log an inspected value
     *
     * @param {*} value
     * @param {Object} [context]
     * @param {Object} [contextStyles]
     * @return {Logger}
     */
    inspectValue(value, context, contextStyles) {
        // Note: inspect is a special function for node:
        // https://github.com/nodejs/node/blob/a1bda1b4deb08dfb3e06cb778f0db40023b18318/lib/util.js#L210
        value = util.inspect(value, { depth: 6 });
        return this.log(value, context, LogLevel.DEBUG, { contextStyles, styles: ['gray'] });
    }

    /**
     * Log an debugged var
     *
     * @param {String} varName
     * @param {*} varValue
     * @param {Object} [context]
     * @param {Object} [contextStyles]
     * @return {Logger}
     */
    inspectVar(varName, varValue, context, contextStyles) {
        varValue = util.inspect(varValue, { depth: 6 });
        return this.log(varName + ' = ' + varValue, context, LogLevel.DEBUG, { contextStyles, styles: ['cyan'] });
    }

    /**
     * Log an sucess message
     *
     * @param {String} message
     * @param {Object} [context]
     * @param {Object} [contextStyles]
     * @return {Logger}
     */
    success(message, context, contextStyles) {
        return this.log(message, context, LogLevel.INFO, {
            contextStyles,
            symbol: '✔',
            styles: ['green', 'bold'],
        });
    }

    /**
     * Stores current time in milliseconds
     * in the timers map
     *
     * @param {string} name timer name
     */
    time(name) {
        if (name) {
            if (!this._timers) {
                this._timers = {};
            }

            return this._timers[name] = Date.now();
        }

        return Date.now();
    }

    /**
    * Finds difference between when this method
    * was called and when the respective time method
    * was called, then logs out the difference
    * and deletes the original record
    *
    * @param {Number=} time return of previous call to time()
    * @param {string} name timer name
     * @param {Object} [context]
     * @param {Object} [contextStyles]
    */
    timeEnd(time, name, context, contextStyles) {
        const now = Date.now();

        if (typeof time !== 'number') {
            contextStyles = context;
            context = name;
            name = time;

            if (!this._timers || !this._timers[name]) {
                return;
            }

            time = this._timers[name];
            delete this._timers[name];
        }

        const diffTime = now - time;
        const seconds = diffTime > 1000 && Math.floor(diffTime / 1000);
        const ms = diffTime - seconds * 1000;

        const message = (name ? name + ': ' : '') + (seconds ? seconds + 's and ' : '') + ms + 'ms';
        this.log(message, context, LogLevel.INFO, { contextStyles });
    }
}

import LogLevel from '../LogLevel';
import ansi from 'ansi-styles';

const levelToSymbol = {};
levelToSymbol[LogLevel.TRACE] = '•';
levelToSymbol[LogLevel.DEBUG] = '•';
levelToSymbol[LogLevel.INFO] = '→';
levelToSymbol[LogLevel.WARN] = '⚠';
levelToSymbol[LogLevel.ERROR] = '✖';
levelToSymbol[LogLevel.CRITICAL] = '!';
levelToSymbol[LogLevel.FATAL] = '‼';
levelToSymbol[LogLevel.EMERGENCY] = '‼';

const levelToStyles = {};
levelToStyles[LogLevel.TRACE] = ['gray'];
levelToStyles[LogLevel.DEBUG] = ['gray'];
// levelToStyles[LogLevel.INFO] = ['gray'];
levelToStyles[LogLevel.WARN] = ['yellow'];
levelToStyles[LogLevel.ERROR] = ['red', 'bold'];
levelToStyles[LogLevel.CRITICAL] = ['red', 'bold'];
levelToStyles[LogLevel.FATAL] = ['bgRed', 'white'];
levelToStyles[LogLevel.EMERGENCY] = ['bgRed', 'white'];

export function style(styles, string) {
    if (!styles.length || !string) {
        return string;
    }

    return styles.reduce(function(string, styleName) {
        let style = ansi[styleName];

        if (!style) {
            throw new Error('Unknown style: ' + styleName);
        }

        return style.open + string + style.close;
    }, string);
}

function displayObject(object, contextStyles) {
    const keys = Object.keys(object);

    if (keys.length === 0) {
        return;
    }

    return '{ ' + keys.map(key => {
        return key + ': ' + this.style(contextStyles && contextStyles[key], JSON.stringify(object[key]));
    }).join(', ') + ' }';
}

/**
 * @param {Object} record
 * @returns {string}
 */
export function format(record) {
    let string = '';
    if (record.prefix) {
        string += this.style(['gray'], record.prefix);
    }

    if (record.datetime) {
        if (string.length !== 0) {
            string += ' ';
        }

        string += this.style(['gray', 'bold'], record.datetime.toTimeString().split(' ')[0]);
        /* new Date().toFormat('HH24:MI:SS') */
    }

    let message = record.symbol || levelToSymbol[record.level];
    let styles = record.styles || levelToStyles[record.level];

    if (record.message) {
        if (message && message.length !== 0) {
            message += ' ' + record.message;
        } else {
            message = record.message;
        }
    }

    if (styles) {
        message = this.style(styles, message);
    }

    if (string.length !== 0) {
        string += ' ';
    }

    string += message;

    if (record.context) {
        const stringObject = displayObject.call(this, record.context, record.contextStyles);

        if (stringObject) {
            if (string.length !== 0) {
                string += ' ';
            }

            string += stringObject;
        }
    }

    if (record.extra) {
        const stringObject = displayObject.call(this, record.extra);

        if (stringObject) {
            if (string.length !== 0) {
                string += ' ';
            }

            string += stringObject;
        }
    }

    return string;
}

