import Handler from '../Handler';
import LogLevel from '../LogLevel';
import LayoutDefault from '../layouts/LayoutDefault';
import * as formatterANSI from '../formatters/formatterANSI';
import * as outputConsole from '../outputs/outputConsole';

const debugValues = process.env.DEBUG && process.env.DEBUG.split(',') || [];

export default class ConsoleHandler extends Handler {
    /**
     * @param {int|string} minLevel if int, see {@link LogLevel} ; if string, based on process.env.DEBUG
     */
    constructor(minLevel) {
        if (typeof minLevel === 'string') {
            minLevel = debugValues.indexOf(minLevel) !== -1 ? LogLevel.ALL : LogLevel.WARN;
        }

        super(
            minLevel,
            new LayoutDefault(formatterANSI),
            outputConsole
        );
    }
}

import Handler from '../Handler';
import LayoutDefault from '../layouts/LayoutDefault';
import * as formatterRaw from '../formatters/formatterRaw';
import OutputString from '../outputs/OutputString';

export default class StringHandler extends Handler {
    /**
     * @param {int} minLevel
     */
    constructor(minLevel) {
        super(
            minLevel,
            new LayoutDefault(formatterRaw),
            new OutputString()
        );
    }

    get string() {
        return this.output.string;
    }

}

export { default as Logger } from './Logger';
export { default as ConsoleLogger } from './ConsoleLogger';
export { default as LogLevel } from './LogLevel';

export default class LayoutDefault {
    constructor(formatter) {
        this.formatter = formatter;
    }

    format(record) {
        return this.formatter.format(record) + '\n';
    }
}

export default class LayoutHTML {
    constructor(formatter) {
        this.formatter = formatter;
    }

    format(record) {
        return '</div>' + this.formatter.format(record) + '</div>\n';
    }
}

import LogLevel from './LogLevel';

const levels = Object.keys(LogLevel).map((key) => {
    return {
        key: key,
        lcKey: key.toLowerCase(),
        value: LogLevel[key],
    };
});

export default levels;

import { createWriteStream } from 'fs';

export default class OutputFile {
    constructor(path) {
        this._stream = createWriteStream(path);
    }

    write(string) {
        this._stream.write(string);
    }
}

export default class OutputString {
    constructor() {
        this._buffer = '';
    }

    get string() {
        return this._buffer;
    }

    write(str, logLevel) {
        this._buffer += str;
        return this;
    }
}

import LogLevel from '../LogLevel';

export function write(string, logLevel) {
    let outKey = logLevel >= LogLevel.ERROR ? 'stderr' : 'stdout';
    process[outKey].write(string);
}

export default class WebProcessor {
    constructor(request) {
        this.request = request;
    }

    process(record) {
        record.extra = record.extra || {};
        record.extra.url = this.request.url;
        record.extra.method = this.request.method;
        record.extra.server = this.request.headers.host;
        record.extra.referrer = this.request.referrer;
        record.extra.ip = this.request.headers['x-forwarded-for'] || this.request.connection.remoteAddress;
    }
}
